import { DatePipe } from '@angular/common';
import { Component, Inject, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';
import { MatSnackBar } from '@angular/material/snack-bar';
import { ApiService } from '@services/api.service';
import { LogService } from '@services/log-service.service';
import { NgxSpinnerService } from 'ngx-spinner';
import { ToastrService } from 'ngx-toastr';

@Component({
  selector: 'app-rubro-edit',
  templateUrl: './rubro-edit.component.html',
  styleUrls: ['./rubro-edit.component.scss']
})
export class RubroEditComponent implements OnInit {

 FormularioData:FormGroup;
  fecha_actual = new Date();
  hora_actual = new Date();
  dataform:any='';
  rubro:any=[];
  moneda:any=[];
  empresa:any=[];
  userConn:any;
  userLogueado: any = [];
  dataRubroEdit_get: any = [];

  public ventana="rubro-create"
  public detalle="rubro-detalle";
  public tipo="transaccion-rubro-POST";

  constructor(private _formBuilder: FormBuilder, private datePipe: DatePipe, private spinner: NgxSpinnerService,
    private api:ApiService, public dialogRef: MatDialogRef<RubroEditComponent>, public _snackBar: MatSnackBar,
    public log_module:LogService, private toastr: ToastrService,  @Inject(MAT_DIALOG_DATA) public dataRubroEdit: any){

    this.dataRubroEdit_get = this.dataRubroEdit.dataRubroEdit;
    this.FormularioData = this.createForm();
  } 

  ngOnInit(): void {
    this.userConn = localStorage.getItem("user_conn") !== undefined ? JSON.parse(localStorage.getItem("user_conn")) : null;
    this.userLogueado = localStorage.getItem("usuario_logueado") !== undefined ? JSON.parse(localStorage.getItem("usuario_logueado")) : null;
  }

  createForm(): FormGroup{
    let usuario_logueado = localStorage.getItem("usuario_logueado") !== undefined ? JSON.parse(localStorage.getItem("usuario_logueado")) : null;
    console.log(this.userLogueado);

    let hour = this.hora_actual.getHours();
    let minuts = this.hora_actual.getMinutes();
    let hora_actual_complete = hour + ":" + minuts;  

    return this._formBuilder.group({
      codigo: [this.dataRubroEdit_get.codigo],
      descripcion: [this.dataform.descripcion, Validators.compose([Validators.required])],

      fechareg: [this.datePipe.transform(this.fecha_actual,"yyyy-MM-dd")],
      horareg: [hora_actual_complete],
      usuarioreg: [usuario_logueado],
    });
  }

  submitData(){
    let data = this.FormularioData.value;
    let errorMessage = "La Ruta presenta fallos al hacer la creacion"+"Ruta:- /venta/mant/verubro/";

    return this.api.update("/venta/mant/verubro/"+this.userConn+"/"+this.dataRubroEdit_get.codigo, data)
      .subscribe({
        next: (datav) => {
          this.rubro = datav;

          this.log_module.guardarLog(this.ventana,this.detalle, this.tipo);
          this.onNoClick();
          this.spinner.show();
          this.toastr.success('Guardado con Exito! ðŸŽ‰');

          location.reload();      
        },

        error: (err) => { 
          console.log(err, errorMessage);
          this.toastr.error('! NO SE GUARDO !');

        },
        complete: () => { }
      })
  }

  getAllEmpresa(user_conn){
    let errorMessage = "La Ruta o el servidor presenta fallos al hacer peticion GET";
    return this.api.getAll('/seg_adm/mant/adempresa/'+user_conn)
      .subscribe({
        next: (datav) => {
          this.empresa = datav;
          //console.log('data', datav);
        },

        error: (err: any) => { 
          console.log(err, errorMessage);
        },
        complete: () => { }
      })
  }

  onNoClick(): void {
    this.dialogRef.close();
  }
}
<div class="p-2">
  <h1 mat-dialog-title>Editar Rubro: {{ dataRubroEdit_get.codigo }}</h1>
  <div style="font-size: 0.6rem;padding: 0 24px 0px;">Los campos (*) son obligatorios</div>
</div>

<div mat-dialog-content>
  <div class="container">
    <form class="example-form" [formGroup]="FormularioData" (ngSubmit)="submitData()">
      <div class="row mb-2">
        <div class="col-md">
          <mat-form-field appearance="outline" class="example-full-width">
            <mat-label>DescripciÃ³n </mat-label>
            <input type="text" matInput [(ngModel)]="dataRubroEdit_get.descripcion" formControlName="descripcion"
              maxlength="50" required>
          </mat-form-field>
        </div>
      </div>

      <div class="mat-dialog-actions" mat-dialog-actions align="end">
        <a mat-button (click)="onNoClick()"><i class="fa fa-arrow-left"></i> Atras</a>
        <button mat-raised-button color="primary" [disabled]="!FormularioData.valid" type="submit"><i
            class="fa fa-save"></i> Guardar
        </button>
      </div>
    </form>
  </div>
</div>
